var drones=[];(function worker(){$.get("http://localhost:8680/api/drone",function(n){for(var t,r,i=0;i<n.length;i++)t=n[i],r=drones.indexOf(t.Id),r===-1?(console.log(t.Id+" is a new id"),$(".DroneList").append("<li><div class=drone"+t.Id+">Id: "+t.Id+", Altitude: "+t.State.Altitude+", Longitude: "+t.State.Longitude+", Latitude: "+t.State.Latitude+"<\/div><\/li>"),drones.push(t.Id)):(console.log(r+" is an existing id"),$(".drone"+t.Id).html("Id: "+t.Id+", Altitude: "+t.State.Altitude+", Longitude: "+t.State.Longitude+", Latitude: "+t.State.Latitude));setTimeout(worker,1e3)})})();